/* Default */
import React from 'react'

/* Packages */
import { NormalizeCss, Box, Flex, Track } from 'react-bee'

const App = () => {
  return (
    <>
      <NormalizeCss />
      <div style={{ background: 'grey' }}>
        <Box>
          <Flex justifyContent='' flexWrap='wrap'>
            <>
              {Array(10)
                .fill()
                .map((empty, i) => (
                  <Track
                    key={i}
                    background={`#${Math.floor(
                      Math.random() * 16777215
                    ).toString(16)}`}
                    flex='1 1 auto'
                    flex
                    justifyContent="center"
                  >
                    {i}
                  </Track>
                ))}
            </>
          </Flex>
        </Box>
      </div>
    </>
  )
}

export default App
